ax_length\",\"\")) - postfix.length);\n      tableName += postfix;\n    }\n\n    // Insert table command.\n    var query = \"\";\n    query += \"INSERT INTO `\" + tableName + \"` (\";\n\n    // Common fields.\n    query += \"`alfresco_id`,\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += \"`document_node-dbid`,\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += \"`folder_node-dbid`,\";\n    }\n    \n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n      for (property in class.properties[j]) {\n        query += \"`\" + property.replace(\":\", \"_\").trim() + \"`,\";\n      }\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \") VALUES (\";\n\n    // Common fields.\n    query += alfresco_id + \",\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += document_node_dbid + \",\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += folder_node_dbid + \",\";\n    }\n\n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n\n      for (property in class.properties[j]) {\n\n        var propertyType = getPropertyType(classInfo, property);\n\n        switch(propertyType) {\n\n          case \"d:boolean\":  query += class.properties[j][property].trim(); break;\n          case \"d:date\":     query += \"STR_TO_DATE(\'\" + class.properties[j][property].trim() + \"\', \'%Y-%m-%d\')\"; break;\n          case \"d:datetime\": query += \"STR_TO_DATE(\'\" + class.properties[j][property].trim() + \"\', \'%Y-%m-%dT%H:%i:%s.%f\')\"; break;\n          case \"d:double\":   query += class.properties[j][property].trim(); break;\n          case \"d:float\":    query += class.properties[j][property].trim(); break;\n          case \"d:int\":      query += class.properties[j][property].trim(); break;\n          case \"d:long\":     query += class.properties[j][property].trim(); break;\n          case \"d:text\":     query += \"\'\" + class.properties[j][property].trim() + \"\'\"; break;\n          default:           query += \"\'\" + class.properties[j][property].trim() + \"\'\"; break;\n        }\n\n        query += \",\";\n      }\n\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \"); \";\n  }\n\n  return query;\n}\n\nfunction getClassInfo(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_metadata_info\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class info not defined for \'\" + className + \"\'.\";\n}\n\nfunction getClassId(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_classes_ids\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class id not defined for \'\" + className + \"\'.\";\n}\n\nfunction getPropertyType(classInfo, propertyName) {\n\n  for (var  i = 0; i < classInfo.length; ++i) {\n    for (metadataInfoPropertyName in classInfo[i]) {\n      if (propertyName.equals(metadataInfoPropertyName)) {\n        return classInfo[i][metadataInfoPropertyName];\n      }\n    }\n  }\n\n  throw \"Property info not defined for \'\" + propertyName + \"\' into the class \'\" + className + \"\'.\";\n}\n'),(17028,53,921,0,'jsScript_type',0,NULL),(17029,53,921,0,'field_name',0,'query'),(17030,53,921,0,'field_rename',0,'query'),(17031,53,921,0,'field_type',0,'String'),(17032,53,921,0,'field_length',-1,NULL),(17033,53,921,0,'field_precision',-1,NULL),(17034,53,921,0,'field_replace',0,'N'),(17035,53,921,0,'cluster_schema',0,NULL),(17036,53,921,0,'row_distribution_code',0,NULL),(17037,55,922,0,'PARTITIONING_SCHEMA',0,NULL),(17038,55,922,0,'PARTITIONING_METHOD',0,'none'),(17039,55,922,0,'id_connection',1,NULL),(17040,55,922,0,'commit',1,NULL),(17041,55,922,0,'sql_field',0,'query'),(17042,55,922,0,'insert_field',0,NULL),(17043,55,922,0,'update_field',0,NULL),(17044,55,922,0,'delete_field',0,NULL),(17045,55,922,0,'read_field',0,NULL),(17046,55,922,0,'sqlFromfile',0,'N'),(17047,55,922,0,'sendOneStatement',0,'N'),(17048,55,922,0,'cluster_schema',0,NULL),(17049,55,922,0,'row_distribution_code',0,NULL),(17050,55,923,0,'PARTITIONING_SCHEMA',0,NULL),(17051,55,923,0,'PARTITIONING_METHOD',0,'none'),(17052,55,923,0,'id_connection',1,NULL),(17053,55,923,0,'sql',0,'SELECT\n MIN(id) AS id,\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect,\n CONCAT(\'{\"properties\":[\', GROUP_CONCAT(CONCAT(\'\"\',name,\'\"\') SEPARATOR \',\'), \']}\') AS fields\nFROM\n dm_custom_metadata\nWHERE\n alfresco_id=${alfresco_id}\n AND is_active=\'Y\'\nGROUP BY\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect'),(17054,55,923,0,'limit',0,'0'),(17055,55,923,0,'lookup',0,NULL),(17056,55,923,0,'execute_each_row',0,'N'),(17057,55,923,0,'variables_